// WITH_RUNTIME

fun box(): String {
    if (t.length != 39971) return "Failed: ${t.length} != 39971"

    val indices = arrayListOf<Int>()
    var q = 0
    while (q >= 0) {
        val i = t.indexOf("---", startIndex = q + 3)
        indices.add(i)
        q = i
    }
    if (indices != expected) {
        val numIndices = indices.size
        val numExpected = expected.size
        for (i in 0 until minOf(numIndices, numExpected)) {
            if (indices[i] != expected[i]) return "Failed numIndices=$numIndices numExpected=$numExpected, mismatch at: $i"
        }
        throw Exception("Should fild a mismatch, but didn't: $indices")
    }

    return t.substring(t.length - 2)
}

